// src/pages/History.js
import React, { useEffect, useState } from 'react';

const History = () => {
  const [flightLogs, setFlightLogs] = useState([]);

  useEffect(() => {
    // Fetch the flight logs from the backend
    const fetchFlightLogs = async () => {
      try {
        const response = await fetch('/api/flight-history/history');
        const data = await response.json();
        setFlightLogs(data);
      } catch (error) {
        console.error('Error fetching flight history:', error);
      }
    };

    fetchFlightLogs();
  }, []);

  return (
    <div>
      <h1>Flight History</h1>
      <ul>
        {flightLogs.map((log, index) => (
          <li key={log._id}>
            <h2>Flight #{index + 1}</h2>
            <p><strong>Drone ID:</strong> {log.drone_id}</p>
            <p><strong>Flight Summary:</strong></p>
            <ul>
              <li><strong>Start Time:</strong> {log.flight_summary.start_time}</li>
              <li><strong>End Time:</strong> {log.flight_summary.end_time}</li>
              <li><strong>Max Altitude:</strong> {log.flight_summary.max_altitude} m</li>
              <li><strong>Average Speed:</strong> {log.flight_summary.average_speed} m/s</li>
              <li><strong>Distance Traveled:</strong> {log.flight_summary.distance_traveled} m</li>
            </ul>
            <p><strong>Events:</strong></p>
            <ul>
              {log.events.map((event, eventIndex) => (
                <li key={eventIndex}>
                  <p>Event: {event.event_type}</p>
                  <p>Time: {event.timestamp}</p>
                  <p>Location: {`Lat: ${event.location.latitude}, Lng: ${event.location.longitude}`}</p>
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default History;
